import './App.css';
import React from 'react';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom'
import Home from './Home';
import AddNew from './AddNew';
import ViewAll from './ViewAll';


function App() {

  return (
    <Router>
      <Routes>
        <Route path="/">
          <Home/>
        </Route>
        <Route path="/add_new">
          <AddNew/>
        </Route>
        <Route path="/view_all">
          <ViewAll/>
        </Route>
      </Routes>
    </Router>
  );
};


export default App;
